defmodule LiveWeb.Components.Photo do
  # this represents the value of code received from the database
  def get_string do
    ~s[
		<main class="container" style="margin: 0 auto; position: relative; width: 100%">
			<div class="wrapper" style="width: 100%; display: grid; padding: 0 20px 20px; gap: 20px; grid-template-rows: auto auto auto auto">
				<div class="brand" style="padding: 20px 0; display: flex; height: 90px; justify-content: center; align-items: center">
					<img
						id="logo"
						src="data:image/png;base64,"
						style="align-self: center; max-width: 100%; height: 100%"
					/>
				</div>
				<div class="content" style="text-align: center">
					<h1
						class="title"
						style="
							margin: 0;
							font-family: Arial, sans-serif;
							color: #0000a0;
							font-size: 27px;
							font-weight: bold;
							display: flex;
							justify-content: center;
							align-items: center;
							height: 45px;
						"
					>
						Add a photo
					</h1>
					<p
						class="description"
						style="
							font-family: Arial, sans-serif;
							color: #333333;
							font-size: 17px;
							line-height: initial;
							display: flex;
							align-items: center;
							justify-content: center;
							padding: 3px 5px;
							min-height: 36px;
							margin-top: 0;
						"
					>
						Then send it to us
					</p>
				</div>
				<div
					class="active-controls"
					style="display: flex; flex-direction: column; align-items: center; gap: 35px; margin-top: 15px"
				>
					<label
						class="tap-to-take-photo"
						style="
							display: flex;
							justify-content: center;
							align-items: center;
							gap: 25px;
							padding: 25px;
							border: 1px solid #333;
							border-radius: 5px;
							width: 100%;
						"
					>
						<input id="open-camera" type="file" accept="image/*" capture="camera" phx-hook="TakePhoto" style="display: none" />
						<img
							id="camera-svg"
							src="data:image/svg+xml;base64,"
							style="width: 100px; display: flex"
						/>
						<p style="font-size: 17px; margin-top: 0">Tap to take a photo</p>
					</label>
					<label
						class="select-from-library"
						style="
							display: flex;
							justify-content: center;
							align-items: center;
							gap: 25px;
							padding: 25px;
							border: 1px solid #333;
							border-radius: 5px;
							width: 100%;
						"
					>
						<input id="open-gallery" type="file" accept="image/*" phx-hook="SelectFromGallery" style="display: none" />
						<img
							id="gallery-svg"
							src="data:image/svg+xml;base64,"
							style="width: 100px; display: flex"
						/>
						<p style="font-size: 17px; margin-top: 0">Use existing photo</p>
					</label>
				</div>
				<div class="buttons" style="margin-top: 15px">
					<button id="no-thanks" class="no-thanks" phx-value-form_data=<%= form_data %>
						phx-value-navigation="none" phx-click="no-thanks" style=" font-family: 'Lato', sans-serif; background-color: #ff1414;
						height: 60px; width: 100%; border-radius: 5px; font-size: 17px; color: #fff; font-weight: normal; text-transform: uppercase;
						outline: none; border: none; cursor: pointer; " > No thanks
					</button>
				</div>
			</div>
		</main>
    ]
  end
end
